import { Link } from 'react-router-dom';
import './App.css';
import {AppBar, Button, IconButton, Stack, Toolbar, Typography} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

import Nav from './components/Nav/Nav';
import { Box, Container } from '@mui/system';

function App() {
  return (
    // <Routes>
    <div className="App">
      <Container sx={{border: '1px solid red', display: 'column', justifyContent: 'center', alignItems: 'center'}}>
        <Box>
      <Typography variant='h3'>Hello From App</Typography>
      </Box>
      <Stack direction='row' spacing={2}>
      <Button variant='contained' href='/navbar'>Navbar</Button>
      <Button variant='outlined' href='/navbar'>Expenses</Button>
      </Stack>
      </Container>
      {/* <Link to={'/navbar'}>Navbar</Link>
      <Link to={'/expense'}>Expense</Link> */}
      {/* <Route path='/navbar' component={<Nav />} /> */}
      {/* <Nav /> */}

      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            News
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </Box>


    </div>
    // </Routes>
  );
}

export default App;
